import request from "./request";

export function MakeCar() {
  return request(
    `http://desafioonline.webmotors.com.br/api/OnlineChallenge/Make`
  )
    .then((res) => res.json())
    .catch((err) => {
      throw err;
    });
}
export function ModelMake(MakeId) {
  return request(
    `http://desafioonline.webmotors.com.br/api/OnlineChallenge/Model?MakeID=3`
  )
    .then((res) => res.json())
    .catch((err) => {
      throw err;
    });
}
export function VersionModel(ModelId) {
  return request(
    `http://desafioonline.webmotors.com.br/api/OnlineChallenge/Version?ModelID=8`,
    {
      method: "DELETE",
      headers: {
        "Content-Type": "application/json",
      },
    }
  )
    .then((res) => res.json())
    .catch((err) => {
      throw err;
    });
}
export function Vehicles(PageId) {
  return request(
    `http://desafioonline.webmotors.com.br/api/OnlineChallenge/Vehicles?Page=1`,
    {
      method: "DELETE",
      headers: {
        "Content-Type": "application/json",
      },
    }
  )
    .then((res) => res.json())
    .catch((err) => {
      throw err;
    });
}
